import React, { Component } from 'react';

class Follow extends Component {

  handleClick = () => {
      console.log('hey')
    }

  render() {
    

    return (

     <div>
        <h2>Name</h2>
        <button>Follow</button>

     </div>
     
    );
  }
}

export default Follow;
